import React from 'react'
import styled from 'styled-components';


const NavigationBar = styled.nav`
  width: 100%;
  height: 20%;
`;

const HomeText = styled.div`
  color: white;
  margin-left: 8%;
  margin-top: 10%;
`;

const Ul = styled.ul`
  width: 30%;
  height: 15%;
`;

const Li = styled.li`
  color: white;
`;

 render(
   <div>
  <NavigationBar>
    <HomeText>Rules of thum</HomeText>
    <Ul>
      <Li>holi</Li>
      <Li>holooo</Li>
      <Li>nfjfhf</Li>
      <Li>dmjdnjdnjd</Li>
    </Ul>
  </NavigationBar>
   </div>
);

    

export default NavigationBar;
